import ImageList from './ImageList'

const Home = ({error, isPending, images}) => {




  return ( 
    <div className="photo-container">
      <h2>Results</h2>
      { error && <div>{ error }</div> }
      { isPending && <div>Loading...</div> }
      { images && <ImageList /> }

  </div>
   );
}

export default Home;
